const box = document.querySelector(".box");

const makeImgTag = (imageURL) => `
  <img
  src = ${imageURL}
  alt=""
  />
 `;

const makeEmailTag = (email) => {
  const userEmail = email.split("@")[0];
  return `
  
  <div class = "email">${userEmail}></div>
  `;
};

const makeSsnTTag = (ssn) => `<div class = "ssn"> ${ssn}<div>`;

const makeMaskedCardTag = (card) => {
  const maskedCard = [...card].map((v, i) => (i < 4 ? "*" : v)).join("");
  return `
  <div class = "cardNumber"> ${maskedCard}</div>
  `;
};

data.forEach((v) => {
  box.insertAdjacentHTML(
    "beforeend",
    `
    <div class="contentBox border ">
        <div class="imgURL">
        ${makeImgTag(v.imageURL)}
        </div>
        
        <div class="emailBox">
        ${makeEmailTag(v.email)}
        </div>

        <div class="ssnBox">
        ${makeSsnTTag(v.ssn)}
        </div>

        <div class="buttonBox">
            <button>SHARE</button>
            <button>LEARN MORE</button>
        </div>

        <div class="cardNumber">
        ${makeMaskedCardTag(v.card)}
        </div>

    </div>


    `
  );
});
